// Teorie.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';
import Button from './Button';  // Asigură-te că calea către componenta Button este corectă

function Teorie() {
    const navigate = useNavigate();

    const handleButtonClick = (buttonNumber) => {
        navigate(`/teorie/${buttonNumber}`);
    };

    return (
        <div className="flex flex-col items-center justify-center border text-center rounded mt-10" style={{width:'15%'}}>
            {Array.from({ length: 20 }, (_, index) => (
                <Button key={index} onClick={() => handleButtonClick(index + 1)} className="w-full my-2 px-4 py-1 rounded bg-blue-500 text-white hover:bg-blue-700 focus:outline-none ml-5">
                    Buton {index + 1}
                </Button>
            ))}
        </div>
    );
}

export default Teorie;
